import React, { useContext } from 'react';
import { AuthContext } from '../auth-context';

const Profile = () => {
  const { auth } = useContext(AuthContext);

  return (
    <div>
      <h2>Profile</h2>
      <p>User ID: {auth.user}</p>
      <p>Roles: {auth.roles.join(', ')}</p>
    </div>
  );
};

export default Profile;
